import { useEffect } from "react";
import AuthUser from './AuthUser';

export default function Home() {
    const { fetchUsers, users } = AuthUser();

  useEffect(() => {
    fetchUsers();
  }, []);

  return (
    <div>
      <h1>User List</h1>
      <ul>
        {users.map(user => (
          <li key={user.id}>{user.name}</li>
        ))}
      </ul>
    </div>
  );
}
